package com.higgs.trust.slave.dao.po.pack;import com.higgs.trust.slave.dao.po.BaseEntity;import java.util.Date;public class PackagePO extends BaseEntity<PackagePO> {    private static final long serialVersionUID = 1L;    /**     * block height     */    private Long height;    /**     * package handle status     */    private String status;    /**     * if or not notify RS, will not retry send transactions of current package to slave     */    private int callbacked;    /**     * package time     */    private Long packageTime;    /**     * create time     */    private Date createTime;    /**     * update time     */    private Date updateTime;    public Long getHeight() {        return this.height;    }    public void setHeight(Long height) {        this.height = height;    }    public String getStatus() {        return this.status;    }    public void setStatus(String status) {        this.status = status;    }    public int getCallbacked() {        return callbacked;    }    public void setCallbacked(int callbacked) {        this.callbacked = callbacked;    }    public Long getPackageTime() {        return this.packageTime;    }    public void setPackageTime(Long packageTime) {        this.packageTime = packageTime;    }    public Date getCreateTime() {        return this.createTime;    }    public void setCreateTime(Date createTime) {        this.createTime = createTime;    }    public Date getUpdateTime() {        return this.updateTime;    }    public void setUpdateTime(Date updateTime) {        this.updateTime = updateTime;    }    @Override public String toString() {        StringBuilder builder = new StringBuilder();        builder.append("PackagePO [");        builder.append("height=");        builder.append(height);        builder.append(", status=");        builder.append(status);        builder.append(", callbacked=");        builder.append(callbacked);        builder.append(", packageTime=");        builder.append(packageTime);        builder.append(", createTime=");        builder.append(createTime);        builder.append(", updateTime=");        builder.append(updateTime);        builder.append("]");        return builder.toString();    }}